import{T as p}from"./index-b5ab17a4.js";import{g as n}from"./getAssetsImg-8e8e1b0d.js";import{_ as e,o as s,O as t,P as r,a}from"./@vue-3f1443a7.js";import"./zzjg-d629ae04.js";import"./index-e379b9df.js";import"./dayjs-4609adfa.js";import"./vue-router-932c2374.js";import"./pinia-b5a043bf.js";import"./element-plus-2b388df7.js";import"./lodash-es-3125e237.js";import"./@vueuse-c95eeb46.js";import"./@element-plus-c80408af.js";import"./@popperjs-b78c3215.js";import"./@ctrl-91de2ec7.js";import"./async-validator-cf877c1f.js";import"./memoize-one-63ab667a.js";import"./escape-html-c01bf6ee.js";import"./normalize-wheel-es-3222b0a2.js";import"./@floating-ui-e2b20dae.js";const i=a("span",null,"学术研究",-1),o={__name:"index",setup(a){const o=e([{title:"研究方向",name:"1",content:`<p>工程研究中心设置了4个研究方向：</p>\n               <h1>研发方向一：城市交通运输智能调度</h3>\n               <p>城市交通网络图优化技术 | 城市交通智能调度技术</p>\n               <img src='${n("reseach_1.png")}' style="display: block;margin:auto;">\n               <br>\n               <h1>研发方向二：城市物流供应链智能优化</h1>\n               <p>城市物流系统规划与优化技术 | 智能仓储与智慧供应链运营管理技术</p>\n                <img src='${n("reseach_2.png")}' style="display: block;margin:auto;">\n               <br>\n               <h1>研发方向三：城市交通安全智能运维</h1>\n               <p>城市道路交通基础设施智能检测技术 | 城市交通主动安全智能预测预警技术</p>\n                <img src='${n("reseach_3.png")}' style="display: block;margin:auto;">\n               <br>\n                <h1>研发方向四：城市交通智慧出行减排</h1>\n               <p>大数据融合与供需资源智能推荐技术 | 城市交通排放智能分析与管控技术</p>\n                <img src='${n("reseach_4.png")}' style="display: block;margin:auto;">\n               <br>\n               `},{title:"科研成果",name:"2",content:""},{title:"成果转化",name:"3",content:"<h1>物流供应链方向-物流与供应链优化平台</h3>\n               <p>中心主任林良才教授的研究成果在8项国际知名期刊排名综合成绩位列中国第一</p>        \n               <p>在运筹学与交通领域顶级期刊和会议DAC, AAAI, SIGMOD等发表论文200余篇</p>\n               <p>入选科技部云服务技术创新团队，产业链协同平台成果获得国家科技进步二等奖</p>\n               <br>\n               <h1>交通运输调度方向-列车运行图编制系统</h1>\n               <p>建立铁路列车运行图智能编制方法，首次提出“单双线合一”智能编图统一算法</p>\n               <p>构建支持群体协同的铁路列车运行图编制技术，解决了传统模式的效率低下问题</p>\n               <p>自主研发全国铁路列车运行图编制系统，首次实现了各部门协同编制列车运行图</p>\n               <p>专家组鉴定认为“整体技术达到了国际领先水平”，近3年经济效益超30亿元</p>\n               <p>成果是铁路运输安全和效率的根本保障，首批入选铁路重大科技创新成果</p>\n               <p>获四川省科技进步一等奖等24项科技进步奖励</p>\n               <br>\n               <h1>交通安全运维方向-交通主动安全运维平台</h1>\n               <p>三维道路路面智能检测装备广泛用于城市道路路面快速巡检及日常检测</p>\n               <p>成果处于国际领先地位，在中国、美国、南非、巴西、日本等国内外大量应用</p>\n               <p>在交通主动安全运维方面的研究成果获得国家科技进步一等奖</p>\n               <p>形成高速公路视频监控联网标准，构建高速公路路网运行状态智能分析系统</p>\n               <p>五年来，在全国多省制定技术标准并应用落地，共节约投资超过6亿元人民币</p>\n               <br>\n               <h1>交通智慧出行方向-智能城市操作系统</h1>\n               <p>该系统是智慧城市与智能交通的数字基石，集多功能一体的智能开放式平台</p>\n               <p>正在合作研发的智慧城市知识库在雄安新区、江苏南通等地进行了示范应用</p>\n               <p>团队已承接大兴国际机场、王府井商业街、成都天府新区等智能城建项目</p>\n               <p>团队负责人郑宇首次提出城市计算理念，在MIT出版《Urban Computing》</p>\n               <p>团队科研成果被央视、新华网、MIT Technology Review等多家权威媒体报道</p>\n               <br>"}]);return(n,e)=>(s(),t(p,{tabValue:o,src:"pic4.png",editableTabsValue:"1"},{left:r((()=>[i])),_:1},8,["tabValue"]))}};export{o as default};
